window.addEventListener("load",()=>{const e=document.querySelector(".d_hbrg");e.addEventListener("click",()=>{e.classList.toggle("d_active"),openMenu(),document.body.classList.contains("o_overflow_hidden")?showOverflow():hideOverflow()})});const openMenu=()=>{const e=document.querySelector(".d_m_m");e.classList.toggle("d_show")},hideOverflow=()=>{document.body.classList.add("o_overflow_hidden")},showOverflow=()=>{document.body.classList.remove("o_overflow_hidden")};